// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import RegistroPage from './pages/RegistroPage';
import LoginPage from './pages/LoginPage';

function App() {
  return (
    <Router>
      <div>
        <h1>Registro y Login de Usuarios</h1>
        <Switch>
          <Route path="/registro">
            <RegistroPage />
          </Route>
          <Route path="/login">
            <LoginPage />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
